// function to find the maximum number of non-overlapping intervals
function f_gold(pairs) {
    var ans = 0;
    var cur = -Infinity;
    // convert the input set to an array
    pairs = Array.from(pairs);
    // sort the array in increasing order of the second element of each pair
    pairs.sort((a, b) => a[1] - b[1]);
    // iterate through the sorted array and count the number of non-overlapping intervals
    for (var i = 0; i < pairs.length; i++) {
        if (cur < pairs[i][0]) {
            cur = pairs[i][1];
            ans += 1;
        }
    }
    // return the maximum number of non-overlapping intervals
    return ans;
}
